  <style>
    .footer {
      position: relative;
      height: auto;
      box-shadow: 0 0 10px rgba(0, 0, 0, .05);
      z-index: 1;
      background: #fff;
      padding: 48px 0;
      width: 100%;
      z-index: 9;
    }

    @media (min-width:1120px) {
      .footer {
        height: 100px;
        padding-top: 0;
        padding-bottom: 0;
      }
    }

    .footer__content {
      display: flex;
      flex-wrap: wrap;
      align-content: center;
    }

    @media (min-width:1120px) {
      .footer__content {
        height: 100px;
      }
    }

    .footer ul {
      font-weight: 500;
      display: block;
      width: 100%;
    }

    .footer ul li {
      margin-bottom: 10px;
    }

    .footer ul li:last-child {
      margin-bottom: 0;
    }

    @media (min-width:1120px) {
      .footer ul {
        display: flex;
      }

      .footer ul li {
        margin-bottom: 0;
      }
    }
